
module.exports = [
  {
    node: function (n2k) {
      return (
        'notifications.heartbeat.' +
        n2k.src +
        '.dataTransmitOffset'
      )
    },
    value: function (n2k) {
      return Number(n2k.fields['Data transmit offset'])
    }
  },
  {
    node: function (n2k) {
      return (
        'notifications.heartbeat.' +
        n2k.src +
        '.sequenceCounter'
      )
    },
    value: function (n2k) {
      return Number(n2k.fields['Sequence Counter'])
    }
  }
]
